          <Route path="/" element={<Layout cartCount={cartItems.length} />}>
            <Route index element={<SearchItems addItem={addItem} />} />
            <Route
              path="cart"
              element={
                <Cart
                />
              }
            />
            <Route
              path="/:id"
              element={
                <ProductDetails addItem={addItem} removeItem={removeItem} />
